// components/Categories.js
import React from 'react';
import './Categories.css';

const categories = [
  { name: "ONDC", icon: "/ondc-icon.png" },
  { name: "Dine-Out", icon: "/dine-out-icon.png" },
  { name: "Food Delivery", icon: "/food-delivery-icon.png" },
  { name: "Fashion", icon: "/fashion-icon.png" },
  { name: "Electronics", icon: "/electronics-icon.png" },
  { name: "Beauty", icon: "/beauty-icon.png" },
];

function Categories() {
  return (
    <div className="categories-section">
      {categories.map((category, index) => (
        <div className="category" key={index}>
          <img src={category.icon} alt={category.name} />
          <p>{category.name}</p>
        </div>
      ))}
    </div>
  );
}

export default Categories;
